  return (
    <div className="App">
      {false && (
        <div>
          <div>
            <video
              id={"video"}
              ref={ownVideoRef}
              autoPlay
              playsInline
              controls={false}
              style={{
                height: "300px",
                width: "300px",
              }}
            />
          </div>
          <div>
            <button
              onClick={() =>
                makeCall().then((res) => {
                  console.log(res);
                })
              }
            >
              CALL
            </button>
          </div>
          <div>
            <button>ANSWER</button>
          </div>
        </div>
      )}
      {false && (
